import React, { useState } from "react";
import { auth } from "../Firebase";
import { signInWithEmailAndPassword } from "firebase/auth";
import houseImg from "../assets/loginhome.avif";
import img from "../assets/logo.png";
import { useNavigate, Link } from "react-router-dom";
import { FaApple, FaFacebook, FaGoogle } from "react-icons/fa";

const LoginPage = () => {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  // Handle Login
  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      await signInWithEmailAndPassword(auth, email, password);
      alert("Login successful!");
    } catch (error) {
      alert(error.message);
    }
  };

  return (
    <div style={{ display: "flex", flexDirection: "column", minHeight: "100vh" }}>
      {/* Navbar */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          padding: "10px 20px",
          borderBottom: "1px solid #ddd",
          flexWrap: "wrap",
        }}
      >
        <button
          onClick={() => navigate("/Home")}
          style={{
            background: "white",
            color: "#007bff",
            border: "1px solid #007bff",
            padding: "6px 12px",
            borderRadius: "6px",
            cursor: "pointer",
            marginBottom: "8px",
          }}
        >
          Back to Home
        </button>

        <Link
          to="/"
          style={{
            display: "flex",
            alignItems: "center",
            textDecoration: "none",
            fontSize: "20px",
            fontWeight: "bold",
            color: "black",
          }}
        >
          <img
            src={img}
            alt="Logo"
            width="40"
            height="40"
            style={{ marginRight: "8px" }}
          />
          Bootstrap
        </Link>

        <button
          onClick={() => navigate("/About-us")}
          style={{
            background: "#007bff",
            color: "white",
            padding: "6px 12px",
            borderRadius: "6px",
            border: "none",
            cursor: "pointer",
            marginBottom: "8px",
          }}
        >
          About Us
        </button>
      </div>

      {/* Main Content */}
      <div
        style={{
          display: "flex",
          flex: 1,
          flexDirection: "row",
          flexWrap: "wrap",
        }}
      >
        {/* Left Form Section */}
        <div
          style={{
            flex: "1 1 100%",
            maxWidth: "500px",
            padding: "30px",
            margin: "0 auto",
          }}
        >
          <h2>Login</h2>
          <form
            onSubmit={handleLogin}
            style={{ display: "flex", flexDirection: "column", gap: "15px" }}
          >
            <label>Email Address</label>
            <input
              type="email"
              placeholder="Enter your email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              style={{
                padding: "10px",
                borderRadius: "6px",
                border: "1px solid #ccc",
              }}
            />

            <label>Password</label>
            <input
              type="password"
              placeholder="Enter your password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              style={{
                padding: "10px",
                borderRadius: "6px",
                border: "1px solid #ccc",
              }}
            />

            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                fontSize: "14px",
                flexWrap: "wrap",
              }}
            >
              <label>
                <input type="checkbox" /> Remember me
              </label>
              <span style={{ color: "#007bff", cursor: "pointer" }}>
                Forgot Password?
              </span>
            </div>

            <button
              type="submit"
              style={{
                background: "#007bff",
                color: "white",
                padding: "10px",
                border: "none",
                borderRadius: "6px",
                cursor: "pointer",
              }}
            >
              Login
            </button>
          </form>

          <div style={{ textAlign: "center", marginTop: "20px" }}>
            <p>or continue with</p>
            <div style={{ display: "flex", justifyContent: "center", gap: "15px" }}>
              <FaApple size={24} />
              <FaFacebook size={24} />
              <FaGoogle size={24} />
            </div>
          </div>

          <div style={{ marginTop: "20px", textAlign: "center" }}>
            Don’t have an account?
            <Link
              style={{ color: "#007bff", cursor: "pointer", marginLeft: "5px" }}
              to="/Signup"
            >
              Create one
            </Link>
          </div>
        </div>

        {/* Right Image Section */}
        <div style={{ flex: "1 1 100%", minHeight: "300px" }}>
          <img
            src={houseImg}
            alt="House"
            style={{
              width: "100%",
              height: "100%",
              objectFit: "cover",
              maxHeight: "600px",
            }}
          />
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
